	public static function index($f1, $f){
		$v2 = (int) ((1 - $f) * 255);
		$v3 = (int) ((1 - $f1*$f) * 255);
		if($v3 < 0) $v3 = 0;
		if($v3 > 255) $v3 = 255;
		$v4 = $v3 << 8;
		if($v2 < 0) $v2 = 0;
		if($v2 > 255) $v2 = 255;
		return $v2 | $v4;
	}

	public static function getGrassColor($f, $f1){
		$ind = self::index($f1, $f)*4;
		return substr(self::$data, $ind, 4);
	}

	public static function getBlendedGrassColor(Level $level, $x, $z){
		$red = $green = $blue = 0;
		for($zoff = -2; $zoff < 3; ++$zoff){
			for($xoff = -2; $xoff < 3; ++$xoff){
				$bid = $level->getBiomeId($x+$xoff, $z+$zoff);
				$biome = BiomeSelector::get($bid);
				$col = $biome->getGrassColor($x, $z);
				$r = ord($col[1]);
				$g = ord($col[2]);
				$b = ord($col[3]);
				$red += $r * 4;
				$green += $g * 4;
				$blue += $b * 4;
			}
		}
		$red = (int) ($red / 96);
		$green = (int) ($green / 96);
		$blue = (int) ($blue / 96);
		
		return "\x00".chr($red & 0xff).chr($green & 0xff).chr($blue & 0xff);
	}

	public static function init(){
		self::$data = gzinflate(base64_decode(self::$data));
		//self::$data = base64_encode(gzdeflate(self::$data));
		if(strlen(self::$data) < 256*256*4){
			ConsoleAPI::warn("grasscolor data length doesnt match excepted!");
			throw new Exception("grasscolor data length doesnt match excepted!");
		}
	}
